// Modo Claro/Modo Oscuro
const modeBtn = document.querySelector(".mode");

modeBtn.onclick = changeMode;

function changeMode() {
    document.body.classList.toggle("dark");
    if (document.body.classList.value.includes('dark')){
        document.querySelector(".mode span").innerHTML = "Modo Claro";
        localStorage.setItem('selected-mode', 'dark');
    }
    else{
        document.querySelector(".mode span").innerHTML = "Modo Oscuro";
        localStorage.setItem('selected-mode', 'light');
    } 
}

// Modal
let gameOver = false;

var modal = document.getElementById("ranking-modal");

var btn = document.getElementById("rankingBtn");

var span = document.getElementsByClassName("close")[0];

btn.onclick = function() {
    modal.classList.toggle("is-visible");
    if (document.querySelector(".game-over").classList.value.includes('is-visible')){
        gameOver = true;
        document.querySelector(".game-over").classList.toggle("is-visible");
    }
}

span.onclick = function() {
    modal.classList.toggle("is-visible");
    if (gameOver){
        document.querySelector(".game-over").classList.toggle("is-visible");
        gameOver = false;
    }
}

window.onclick = function(event) {
    if (event.target == modal) {
        modal.classList.toggle("is-visible");
        if (gameOver){
            document.querySelector(".game-over").classList.toggle("is-visible");
            gameOver = false;
        }
    }
}   

